import (
	context "context"
	rapiddocs "github.com/mixed-case/rapiddocs"
	rapiddocsclient "github.com/mixed-case/rapiddocs/client"
)

client := rapiddocsclient.NewClient()
response, err := client.Service.ListResources(
	context.TODO(),
	&rapiddocs.ListResourcesRequest{
		PageLimit: 10,
		BeforeDate: rapiddocs.MustParseDate(
			"2023-01-01",
		),
	},
)

